import React, { Component } from 'react';


class JobHeader extends Component {
    render() { 
        return ( 
            <div className="job-header">
                <table>
                    <tr>
                        <td className="logo-col">
                        <img src = {this.props.picture}
                className="company-logo"
                alt="Company logo"></img>
                        </td>
                        <td className="job-col">

                        </td>
                        <td className="duration-col">

                        </td>
                    </tr>
                </table>


 
                <h5 className="d-inline font-weight-bold m-2">{this.props.description}</h5>
                <p className="d-inline">{this.props.duration}</p>
   

            </div>
         );
    }
}
 
export default JobHeader;
